import * as React from 'react';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
  // hide last border
  '&:last-child td, &:last-child th': {
    border: 0,
  },
}));

function createData(shiftName, startDate, endDate, nurseAssigned, certRequired) {
  return { shiftName, startDate, endDate, nurseAssigned, certRequired };
}

const rows = [
  createData(
    "MedSurg 1",
    "2022-12-01T00:00:00Z",
    "2022-12-01T04:00:00Z",
    "Del Hatchell",
    "LPN"
  ),
  createData(
    "MedSurg 2",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Mitchell Bagnall",
    "RN"
  ),
  createData(
    "MedSurg 3",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Tom Baxter",
    "RN"
  ),
  createData(
    "MedSurg 4",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Tim Horton",
    "RN"
  ),
  createData(
    "MedSurg 5",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Dave Jennings",
    "LPN"
  )
];

export default function ShiftsListingPage() {
  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 700 }} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>Shift</StyledTableCell>
            <StyledTableCell align="right">Start Time</StyledTableCell>
            <StyledTableCell align="right">Endn Time</StyledTableCell>
            <StyledTableCell align="right">
              Certification Required
            </StyledTableCell>
            <StyledTableCell align="right">Assigned Nurse</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <StyledTableRow key={row.name}>
              <StyledTableCell component="th" scope="row">
                {row.shiftName}
              </StyledTableCell>
              <StyledTableCell align="right">{row.startDate}</StyledTableCell>
              <StyledTableCell align="right">{row.endDate}</StyledTableCell>
              <StyledTableCell align="right">{row.nurseAssigned}</StyledTableCell>
              <StyledTableCell align="right">{row.certRequired}</StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
